        src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRPNZNK4t9PTQ16-quMqXbOx-GCYstAARJHjA&usqp=CAU"
        alt="error"
      />
    </section>
  );
}

export default Banner;
